import ExpenseDate from './ExpenseDate';
import ExpenseItem from './ExpenseItem';

export default function Expenses({ expenses }) {
	const { id, title, amount, date } = expenses;
	return expenses.map(expense => {
		return (
			<ExpenseItem
				key={expense.id}
				id={expense.id}
				title={expense.title}
				amount={expense.amount}
				date={expense.date}
			/>
		);
	});
}
